import React from 'react'
import Table from './Table'

const characters = [
      {
        start: 'Charlie',
        end: 'Janitor',
      },
      {
        start: 'Mac',
        end: 'Bouncer',
      },
      {
        start: 'Dee',
        end: 'Aspring actress',
      },
      {
        start: 'Dennis',
        end: 'Bartender',
      },
];


function MyApp() {
    return (
      <div className="container">
	<Table characterData={characters} />
      </div>
    );
}

export default MyApp;
